import React from 'react';
import Board from './Board';
import Rules from './Rules';
import './plannertemp.css';


class ModulePlannerPageTemp extends React.Component {
   constructor(props) {
       super(props);

   }


    componentDidMount() {
        // Call our fetch function below once the component mounts
      this.callBackendAPI()
        .then(res => this.setState({ module: res }))
        .catch(err => console.log(err));


    }
      // Fetches our GET route from the Express server. (Note the route we are fetching matches the GET route from server.js
    callBackendAPI = async () => {
      const response = await fetch('', {'accept': 'application/json'});
      const body = await response.json();

      if (response.status !== 200) {
        throw Error(body.message) 
      }
      console.log(body);
      return body;
    };
    render () {
        return (
            <div className="container">
                <Board 
                        id="board-1"
                        className="board"
                        year="Year 1"
                        generateModuleCards={this.generateModuleCards}>

                </Board>

                <Board 
                        id="board-1"
                        className="board"
                        year="Year 2"
                        generateModuleCards={this.generateModuleCards}>

                </Board>

                <Board 
                        id="board-1"
                        className="board"
                        year="Year 3"
                        generateModuleCards={this.generateModuleCards}>

                </Board>

                <Board 
                        id="board-1"
                        className="board"
                        year="Year 4"
                        generateModuleCards={this.generateModuleCards}>

                </Board>
                <br/>
                <Rules/>


            </div>
        )
    }
}

export default ModulePlannerPageTemp;
